import React,{useEffect, useState} from "react";

const Effect = () =>{
    const[data, setData] = useState();

    useEffect(()=>{
        fetch('https://fakestoreapi.com/products')
        .then(response => response.json())
        .then(json => setData(json))
    },[])


return(
    <div className="container">
        <div className="box">
            data.map((product) = {

                    <ol>
                        <li>{product.title}</li>
                    </ol>

            })
        </div>
    </div>
)

}

export default Effect;
